webpackJsonp([0x7c640089215d],{337:function(e,t){e.exports={data:{contentfulLesson:{title:"Week One",week:1,content:{childMarkdownRemark:{html:'<p><strong>Read:</strong></p>\n<ul>\n<li>Knowing is not doing: 4 keys to making sure you are actually making progress.</li>\n<li>It is a marathon: lessons about behavior change taken from the first three miles.</li>\n<li>Having a vision for the future: What is your stretch goal?</li>\n</ul>\n<p><strong>Objectives:</strong></p>\n<ul>\n<li>At the end of this week, you will understand the value of tiny habits for building sustainable behavior change.</li>\n<li>At the end of this week, you will know the benefit of having a stretch goal.</li>\n<li>At the end of this week, you will have established your daily habit and started to implement it.</li>\n<li>At the end of the week, you will have begun logging your behavior change progress.</li>\n</ul>\n<p><strong>Activities:</strong></p>\n<p><em>Day One:</em></p>\n<ul>\n<li>Read: <em><a href="http://happierandhealthieryou.com">Knowing is not doing: 4 keys to making sure you are actually making progress.</a></em></li>\n<li>Make a list of 5 things you can start doing today that are:  simple, can be completed daily, is easy enough that you are guaranteed to succeed.</li>\n</ul>\n<p><em>Day Two:</em></p>\n<ul>\n<li>Make a list of 5 additional things you can start doing today to work towards your goal.</li>\n<li>Review the list of 10 things and eliminate all of them other than the 3 best ideas.</li>\n</ul>\n<p><em>Day Three:</em></p>\n<ul>\n<li>Review the list of three habits you can start today, that will help you begin your journey towards successfully reaching your end goal.</li>\n<li>Pick one of the three habits, go do it today.</li>\n<li>Write down (log) somewhere that you completed the habit.</li>\n</ul>\n<p><em>Day Four:</em></p>\n<ul>\n<li>Read: <em>[It is a marathon: lessons about behavior change taken from the first three miles.]({{ site.baseurl }}{% post_url 2017-09-25-its-a-marathon %})</em></li>\n<li>Complete your daily habit and log it.  </li>\n</ul>\n<p><em>Day Five:</em></p>\n<ul>\n<li>Complete your daily habit and log it.</li>\n</ul>\n<p><em>Day Six:</em></p>\n<ul>\n<li>Read: <em>[Having a vision for the future: What is your stretch goal?]({{ site.baseurl }}{% post_url 2017-09-25-what-is-your-stretch-goal %})</em></li>\n<li>Write down 3 versions of your stretch goal</li>\n<li>Complete your daily habit and log it.</li>\n</ul>\n<p><em>Day Seven:</em></p>\n<ul>\n<li>Review your list of 3 stretch goals, choose one.</li>\n<li>Complete your daily habit and log it.</li>\n</ul>'}}},allContentfulLesson:{edges:[{node:{title:"Week One",week:1,slug:"week-one",youtube:"https://www.youtube.com/playlist?list=PLAg5pHvM_nE3fE0QsmYRIk9z3tW5ovgEg",soundcloud:"https://soundcloud.com/user-335920184/sets/happier-and-healthier-you"}},{node:{title:"Week Two",week:2,slug:"week-two",youtube:"https://www.youtube.com/playlist?list=PLAg5pHvM_nE3fE0QsmYRIk9z3tW5ovgEg",soundcloud:"https://soundcloud.com/user-335920184"}},{node:{title:"Week Three",week:3,slug:"week-three",youtube:"https://www.youtube.com/playlist?list=PLAg5pHvM_nE3fE0QsmYRIk9z3tW5ovgEg",soundcloud:"https://soundcloud.com/user-335920184"}},{node:{title:"Week Four",week:4,slug:"week-four",youtube:"https://www.youtube.com/playlist?list=PLAg5pHvM_nE3fE0QsmYRIk9z3tW5ovgEg",soundcloud:"https://soundcloud.com/user-335920184/sets/happier-and-healthier-you"}}]}},pathContext:{slug:"week-one"}}}});
